import "./scss/style.scss";

const paramsString = "https://nethergames.de:1763/check?message=" + "&render=true";
const searchParams = new URLSearchParams(paramsString);

const parseUrl = () => {
  console.log(searchParams.toString());
}


const App = () => {
  return (
    <div className="container">
      <div className="container__text">
        <textarea className="container__input"></textarea>
      </div>
      <div onClick={parseUrl} className="container__button">Button</div>
    </div>
  );
};

export default App;
